const MediaComponents = ( function() { // eslint-disable-line no-unused-vars

  /**
   * Components for V Media Plugin
   *
   */

  'use strict';

  V.setStyle( {
    'iframe-wrapper': {
      'position': 'relative',
      'padding-bottom': '56.25%',
    },
    'paragraph .iframe-wrapper': {
      'margin-bottom': '20px',
    },
    'iframe-wrapper iframe': {
      position: 'absolute',
      top: '0',
      left: '0',
      width: '100%',
      height: '100%',
    },
    'media-text a': {
      color: 'rgba(var(--link), 1)',
    },
  } );

  function handleProfileDraw() {
    const path = V.castPathOrId( this.textContent );
    V.setState( 'active', { navItem: path } );
    V.setBrowserHistory( path );
    Profile.draw( path );
  }

  function videoFeature( link ) {
    if ( link.match( /youtu/ ) ) {
      return V.castYouTubeIframe( link );
    }
    else if ( link.match( /vimeo/ ) ) {
      return V.castVimeoIframe( link );
    }
  }

  function mediaCard( cardData ) {

    const $cardContent = V.cN( {
      t: 'media',
      c: 'contents',
    } );

    const $title = V.cN( {
      t: 'h2',
      c: 'font-bold fs-l pxy cursor-pointer',
      h: cardData.fullId,
      k: handleProfileDraw,
    } );

    const $feature = V.castDescription( cardData.properties.description ).$feature;
    const $descr = V.castDescription( cardData.properties.description ).$description;

    if ( $feature ) {
      V.setNode( $cardContent, [$title, $feature, $descr ] );
    }
    else {
      V.setNode( $cardContent, [$title, $descr ] );
    }

    return $cardContent;
  }

  function featureUl() {
    return V.cN( {
      tag: 'ul',
    } );
  }

  function pdfCard() {
    return V.cN( {
      h: [
        {
          t: 'img',
          a: {
            src: 'data:image/png;base64,', // TODO: insert data URI here
            alt: 'HU-MOD Modell Abbildung',
            style: [
              'max-width: 100%',
              'height: auto',
              'display: block',
              'margin: 0 auto 18px auto',
              'border-radius: 16px',
              'box-shadow: 0 2px 8px rgba(79,140,255,0.10)'
            ].join(';')
          }
        },
        {
          t: 'p',
          c: 'pxy',
          h: 'Das Modell HU-MOD (Brock et al. 2012, Knebl et al. 2015) wurde von Wissenschaftler*innen der Universitten Giessen und Freising-Weihenstephan entwickelt. Es berechnet Mengennderungen der organischen Bodensubstanz an einem Standort unter Nutzung der N-Aufnahme in den Kulturpflanzen als Response-Indikator des spezifischen Umsatzes der organischen Bodensubstanz unter den gegebenen Bedingungen.',
        },
        {
          t: 'button',
          c: 'download-btn pxy',
          h: [
            //V.getIcon && V.getIcon('download', '18px'),
            { t: 'span', h: 'PDF herunterladen' }
          ],
          a: {
            style: [
              'background: linear-gradient(90deg, #4f8cff 0%, #235390 100%)',
              'color: #fff',
              'border: none',
              'border-radius: 24px',
              'padding: 10px 24px',
              'font-size: 1rem',
              'font-weight: bold',
              'cursor: pointer',
              'box-shadow: 0 2px 8px rgba(79,140,255,0.15)',
              'display: inline-flex',
              'align-items: center',
              'gap: 8px',
              'margin-top: 18px',
              'transition: background 0.2s, box-shadow 0.2s',
            ].join(';')
          },
          k: function handleHuModPDFDownload(e) {
            e.stopPropagation();
            window.open('https://vi-app-server.netlify.app/assets/pdfs/HU-MOD.pdf', '_blank');
          }
        },
      ],
    } );
  }

  return {
    videoFeature: videoFeature,
    mediaCard: mediaCard,
    featureUl: featureUl,
    pdfCard: pdfCard,
  };

} )();
